    border: 10px double #8a1b8a;
    border-radius: 24px;
    box-shadow: 0 0 30px rgba(0,0,0,0.4);
    overflow: hidden;
  }

  .overlay {
    position: absolute;
    inset: 0;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: flex-start;
    text-align: center;
    color: #3c003c;
    padding-top: 130px; /* more gap from top */
  }

  .doctor-photo {
    width: 120px;
    height: 120px;
    border-radius: 50%;
    border: 5px solid #8a1b8a;
    object-fit: cover;
    margin-bottom: 15px;
    background-color: white;
    box-shadow: 0 4px 10px rgba(0,0,0,0.4);
  }

  .doctor-name {
    font-size: 1.3em;
    font-weight: 700;
    color: #4a004a;
    text-shadow: 1px 1px 2px rgba(255,255,255,0.8);
  }

  .doctor-speciality {
    font-size: 1.05em;
    margin-bottom: 25px;
    color: #4a004a;
    font-weight: 500;
  }

  .controls {
    margin-top: 25px;
    text-align: center;
  }

  .controls input {
    margin: 6px;
    padding: 8px;
    border-radius: 8px;
    border: 1px solid #bbb;
    width: 220px;
  }

  .controls label {
    font-weight: bold;
    display: block;
    margin-top: 8px;
  }

  .preview-title {
    font-weight: bold;
    margin-top: 15px;
    font-size: 1.2em;
    color: #8a1b8a;
    letter-spacing: 0.5px;
  }

  #downloadBtn {
    margin-top: 18px;
    padding: 10px 24px;
    background: linear-gradient(90deg,#8a1b8a,#c93cc9);
    color: white;
    border: none;
    border-radius: 10px;
    font-size: 1em;
    cursor: pointer;
    box-shadow: 0 4px 10px rgba(0,0,0,0.3);
    transition: all 0.3s ease;
  }

  #downloadBtn:hover {
    background: linear-gradient(90deg,#a32fa3,#e44ee4);
    transform: scale(1.05);
  }

<body>
  <h2 class="preview-title"> Diwali E-Greeting Live Preview </h2>
  <div class="card" id="greetingCard">
    <div class="overlay">
      <img id="photoPreview" class="doctor-photo" src="" alt="Doctor Photo">
      <div id="namePreview" class="doctor-name"></div>
      <div id="specPreview" class="doctor-speciality"></div>
    </div>
  </div>

  <div class="controls">
    <label>Upload Doctor Photo:</label>
    <input type="file" id="photoInput" accept="image/*">

    <label>Doctor Name:</label>
    <input type="text" id="nameInput" placeholder="Enter Doctor's Name">

    <label>Speciality:</label>
    <input type="text" id="specInput" placeholder="Enter Speciality">

    <button id="downloadBtn"> Download Greeting</button>
  </div>

<script src="https://cdn.jsdelivr.net/npm/html2canvas@1.4.1/dist/html2canvas.min.js"></script>
<script>
  const photoInput = document.getElementById('photoInput');
  const photoPreview = document.getElementById('photoPreview');
  const nameInput = document.getElementById('nameInput');
  const specInput = document.getElementById('specInput');
  const namePreview = document.getElementById('namePreview');
  const specPreview = document.getElementById('specPreview');
  const downloadBtn = document.getElementById('downloadBtn');
  const card = document.getElementById('greetingCard');

  // Preview photo
  photoInput.addEventListener('change', function() {
    const file = this.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = function(e) {
        photoPreview.src = e.target.result;
      };
      reader.readAsDataURL(file);
    }
  });

  // Update name and speciality live
  nameInput.addEventListener('input', () => {
    namePreview.textContent = nameInput.value;
  });

  specInput.addEventListener('input', () => {
    specPreview.textContent = specInput.value;
  });

  // Download greeting as image (preserves exact shape and size)
  downloadBtn.addEventListener('click', () => {
    html2canvas(card, {useCORS: true, scale: 2}).then(canvas => {
      const link = document.createElement('a');
      link.download = 'Diwali_Greeting.png';
      link.href = canvas.toDataURL('image/png');
      link.click();
    });
  });
</script>
</body>
</html>
